from indic_transliteration import sanscript
import ujson

result = {}
for (id, verbform, tense, purusha_vachana, finite) in data:
	verbform = sanscript.transliterate(verbform.decode('utf-8'), 'iast', 'slp1')
	if verbform not in result:
		result[verbform] = []
	result[verbform].append({'id': id, 'tense': tense, 'purusha_vachana': purusha_vachana, 'finite': finite})

with open('../prakriya/data/dcs.json', 'w') as fin:
	fin.write(ujson.dumps(result, indent=4))

